import React from 'react';
import styled from '@emotion/styled';


function Navbar() {
    return (
        <React.Fragment>
            <ul>
                <li>About</li>
                <li>Resume</li>
                <li>Projects</li>
            </ul>
        </React.Fragment>
    );
}
export default Navbar;
